import React from 'react';
import './App.css';
import logo from './img/logonexter.png';

function App() {
  return (
    <div className="App">
      <header className="app-header">
        <h1 className="main-title">RACESENSE</h1>

        <div className="button-container">
          <div className="button-row">
            <button className="menu-btn">Circuiti</button>
            <p className="developed-by">sviluppato da</p>

            <button className="menu-btn">Piloti</button>
            <button className="menu-btn">Campionati</button>
          </div>

          <button className="race-btn">START RACE</button>
        </div>
      </header>

      <footer className="app-footer">
        <div className="footer-content">
          <p className="developed-by">sviluppato da</p>
          <img src={logo} alt="Logo Nexter" className="footer-logo" />
        </div>
      </footer>
    </div>
  );
}

export default App;
